    cursor:default ;
}

.line {
    background: url(reg_hr.3714f0c1.png) no-repeat top center;
    height: 20px;
    width: 100%;
    margin: 0 auto;
}

header {
    width:980px;
    height:76px;
    margin: 0 auto;
    position: relative;
}

.header-logo {
    float: left;
    overflow: hidden;
    width: 330px;
    height: 76px;
    padding-top: 5px;
    text-align: left;
}

.header-logo a {
    font-size:18px;
    width: 330px;
    line-height: 76px;
    color: #666;
    text-decoration: none;
}
.header-logo a img {
    vertical-align:middle;
    padding-right: 8px;
}

