    padding-left: 8px;
}

.header-right {
    float: right;
    overflow: hidden;
    height: 75px;
    line-height: 75px;
    display: block;
}

.right-text {
    color:#666;
    font-size: 12px;
}

.header-right  .input-button {
    width: 64px;
    height: 32px;
    display: inline-block;
    background: rgb(243, 241, 241);
    border:1px solid rgb(228, 224, 224) ;
    cursor: pointer;
    border-radius: 10%;
    font-family: 'Courier New', Courier, monospace;
